import logo from './main/logo.png';
import contents from './main/contents.png';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
const navigate = useNavigate();
const getLoginPage = () => {
  navigate("https://signin.intra.42.fr/users/sign_in");
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <figure>
        <img src={contents} className="App-content" alt="content-bg"/>
        <figcaption><button className="App-btn" onClick={getLoginPage}></button></figcaption>
        </figure>
      </header>
    </div>
  );
}

export default App;

